function insert(elm, line){
    var typed = new Typed(elm, {
    strings: [line],
    typeSpeed: 0,
    showCursor: false,
    onComplete: (self) => {document.getElementById('form').style['visibility'] = "visible"}
    });
}

async function border_small(element) {
    var form = document.getElementById(element).innerHTML;
    document.getElementById(element).innerHTML = '';
    var width = document.getElementById(element).offsetWidth;
    var height = document.getElementById(element).offsetHeight;
    var lineTB = '#'.repeat(width/8.2) + '#\n';
    var lineE = '<p class=lb>#</p><p class=rb>#</p>';
    var lineB = '#'.repeat(height/8.2);
    var lines = lineTB + lineE.repeat(height/18.5 - 2) + lineTB;
    await insert("#" + element, lines);
};

async function border_large(element) {
    var form = document.getElementById(element).innerHTML;
    document.getElementById(element).innerHTML = '';
    var width = document.getElementById(element).offsetWidth;
    var height = document.getElementById(element).offsetHeight;
    var lineTB = '#'.repeat(width/8.2) + '#\n';
    var lineE = '<p class=lb>#</p><p class=rb>#</p>';
    var lineB = '#'.repeat(height/8.1);
    var lines = lineTB + lineE.repeat(height/17 - 2) + lineTB;
    await insert("#" + element, lines);
};

